const estilo = {
    backgroundColor: "#FF000F",
    color: "#FFFFFF"
}


export const MeusDados = (props) => {
    return (
        <div style={estilo}>
            <h2>Nome: {props.nome} </h2>
            <h2>Curso: {props.curso}</h2>
            <h2>Universidade: {props.universidade}</h2>
        </div>
    )
}

export const MeusDadosComDestruturacao = ({}) => {
    return (
        <div style={estilo}>
            <h2>Nome: {props.nome} </h2>
            <h2>Curso: {props.curso}</h2>
            <h2>Universidade: {props.universidade}</h2>
        </div>
    )
}
